import React from 'react'
class Displayin4 extends React.Component {
    render(){
        const {lannisters} = this.props;
        const { name,age,death } = this.props;
        return(
            <div>
                {lannisters.map((character) => {
                    return(
                        <div>
                            <div>My name {character.name} I am {character.age} I live in {character.address} </div> 
                        </div>
                    )
                })}
                <div>My name in {name } i am {age} and i was murdered by a {death}</div>
            </div>
            
            
        )   
    }
}   
export default Displayin4;
